import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import HospitalSimulator from "./simulators/hospital/HospitalSimulator";
import FoodChainSimulator from "./simulators/food-chain/FoodChainSimulator";
import Layout from "./components/Layout";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Dashboard />} />
          <Route path="simulators">
            <Route path="hospital" element={<HospitalSimulator />} />
            <Route path="food-chain" element={<FoodChainSimulator />} />
          </Route>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
